window.bookSummaryJSON = "<p>After 30 years, Matti has learned that the dwarven mother she believed dead might only be missing—kidnapped by those who want to control her ability to enchant powerful world-changing artifacts.</p> <p>But where is she now? And why is the elf assassin Sarrlevi so invested in helping find her?</p> <p>Matti knows she shouldn’t trust Sarrlevi or be drawn to his dry humor and dark past. But he keeps standing at her side to battle enemies, and she keeps forgetting that he might be an enemy himself....</p>"; 
